import styles from './login.module.css';
import Input from '../../../Components/Compartido/Input';
import { useForm } from "react-hook-form";


const Login = (props) => {
  const { register, handleSubmit, formState: { errors } } = useForm();
  const onSubmit = async (event) => {}
  return (
      <div>
        <form onSubmit={handleSubmit(onSubmit)}>
          <div className={styles.card}>
            <div>
              <label>Usuario</label>
              <Input
                register={register}
                requiredMany={{ required: true, maxLength: 8, minLength: 5, pattern: /(^$)|[a-zA-Z0-9]/ }}
                nameRegister={'name'}
                placeholder={'Nombre de usuario'}
              />
              {errors.name?.type === 'required' && <p className={styles.fail}>Es requerido ingresar el usuario</p>}
              {errors.name?.type === 'maxLength' && <p className={styles.fail}>Máximo 8 caracteres</p>}
              {errors.name?.type === 'minLength' && <p className={styles.fail}>Mínimo 2 caracteres</p>}
              {errors.name?.type === 'pattern' && <p className={styles.fail}>No puede haber espacios</p>}
            </div>
            <div>
              <label>Contraseña</label>
              <Input
                register={register}
                nameRegister={'description'}
                requiredMany={{ required: true, maxLength: 10, pattern: /(^$)|[a-zA-Z0-9]/ }}
                placeholder={'Contraseña'}
              />
              {errors.description?.type === 'required' && <p className={styles.fail}>Ingrese su contraseña</p>}
              {errors.description?.type === 'maxLength' && <p className={styles.fail} >Máximo 10 caracteres</p>}
              {errors.description?.type === 'pattern' && <p className={styles.fail} >No puede haber espacio</p>}
            </div>
            <div className={styles.cardButton}>
              <div>
                <button className={styles.cancel} onClick={() => props.history.push('/products')}>
                  Cancelar
                </button>
              </div>
              <div>
                <button className={styles.confirm} type="submit">
                  Iniciar Sesión
                </button>
              </div>
            </div>
          </div>
        </form>
      </div>
    );
  };

export default Login;
